import React from "react";

const CountryButton = (prop) => {
  return (
    <div>
      <ul>
        <li>
          <button value="Japan" onClick={prop.handleOnclick}>
            Japan
          </button>
        </li>
        <li>
          <button value="Philippines" onClick={prop.handleOnclick}>
            Philippines
          </button>
        </li>
      </ul>
    </div>
  );
};

export default CountryButton;
